import React,{ Component } from 'react';
import './App.css';

class  App extends Component {
  constructor(){
    super();
    this.state ={
      string:"Hello,This is first starting point of react js.",
      monsters:[
        {
          name:"Frankenstein",
          id:'1'
        },
        {
          name:"Werewolf",
          id:'2'
        }
      ]
    };
  }
  render(){
    return(
      <div className="App">
        {this.state.monsters.map(monster =>(
          <h1 key= {monster.id}>{monster.name}</h1>
        ))}
      </div>
    );
  }

}

export default App;
